const char* getNamedResource (const char* resourceNameUTF8, int& numBytes)
{
    unsigned int hash = 0;

    if (resourceNameUTF8 != nullptr)
        while (*resourceNameUTF8 != 0)
            hash = 31 * hash + (unsigned int) *resourceNameUTF8++;

    switch (hash)
    {
        case 0x7768db88:  numBytes = 226264; return bigFiles_txt;
        case 0x2aaab85f:  numBytes = 3115; return README_txt;
        default: break;
    }

    numBytes = 0;
    return nullptr;
}

